measurements.description:
Forty-six flat round flowers on two up to 96-cm arched inflorescences; 
  sepals and petals elliptical, burnt umber, dark veins, more prominent midline;
   lip orange-yellow overlaid maroon along edge, black-maroon blotches and spots, dark maroon line centrally;
   column orange-yellow spotted maroon, anther cap white; substance firm;
 texture matte; upgrade from previous award 20225258.
